import { useEffect, useState } from 'react'

function Content() {
  const [comments, setComments] = useState([])
  useEffect(() => {
    fetch('https://jsonplaceholder.typicode.com/comments')
      .then(res => res.json())
      .then(data => {
        setComments(data)
      })
    console.log(comments.name)
  }, [])

  return (
    <div>
      <h1>Hello My Name Huy</h1>
      <ul>
        {comments.map(data => (
          <li>{data.name}</li>
        ))}
      </ul>
    </div>
  )
}

export default Content
